import './App.css';
import Album from './components/Album';
import data from './components/data';

function App() {
  return (
    <div className="App">
      {data.map(animal => (
        <Album
          key={animal.name}
          name={animal.name}

        />
      ))}
    </div>
  );
}

export default App;
